import React from 'react';

import './roomitem.css';

export default function RoomItem({name, userCount, click}) {
  return (
    <div 
      className="room-item">
      onClick={() => click}
    >
      <p> {name} </p>
      <p> {userCount} </p>
    </div>
  );
}
